import React from 'react'

function PanelCard({ anime }) {
    let className = "panels_panel-" + anime.num;
    return (
        <div className={className}>
            <a
                href={anime.url}
                target="_blank"
                rel="noreferrer">
                <figure>
                    <img src={anime.image_url} alt="anime image" />
                </figure>
            </a >
        </div >
    )
}

export default PanelCard
